import { StyleSheet, Text, View } from "react-native";
import React from "react";

const PaymentScreen = () => {
  return (
    <View>
      <Text>PaymentScreen</Text>
    </View>
  );
};

export default PaymentScreen;

const styles = StyleSheet.create({});
